import {MDBCarouselCaption} from "mdbreact";
function Home() {
  return (
      <div className="App">
        <MDBView>
              <img
                className="d-block w-100"
                src="https://uploads-ssl.webflow.com/5cd1e68968db65ba07de7bfb/5ff61d6f3b91b94292b936cc_krafty_photos_kamphaus-13.jpg"
                alt="First slide"
              />
              <MMask overlay="black-light" />
            </MDBView>
            <MDBCarouselCaption>
              <h3 className="h3-responsive">Light mask</h3>
              <p>First text</p>
            </MDBCarouselCaption>
          <img src={"https://uploads-ssl.webflow.com/5cd1e68968db65ba07de7bfb/5fee46ab47d282950f001ff1_Jupe%20Lit%20Exterior%20(photo%20credit_%20Sam%20Gezari).jpg"}/>

      </div>
  );
}

export default Home;
